text:
@guardian_sport
Due to postponements and bye-weeks in the League of Ireland First Division, for the third consecutive week a club will start their league season with a match against Cork City.

One for The Fiver - what club has played in the most league openers in the one season?

@davenol @MarkPaulTimes @carolmhunt Not a disease? Somebody better tell the World Health Organisation.

"Coronavirus disease (COVID-19) is an infectious disease caused by a newly discovered coronavirus."

https://t.co/4fDTcXrJks

@MountainAsh2020 "Going forward the party will not be able to walk this tightrope so clumsily...
With these kinds of conflicting messages in Dublin and Belfast, voters won't buy the message that "the all-island party" are anything of the sort."

Yeah real propaganda stuff.

@johngosullivan That says "the club" want Alan Reynolds to take over as manager.
1) Who is "the club"?
2) He only just joined Shels?

@newschambers A source said the love rat - an Irish  football star* - was caught romping with a teammates' celeb** girlfriend.

*Once came off the bench in injury time in an LOI First Division match.

**has a lot of followers on Instagram

@eoinneylon @RayMinehane @daracalleary Eoin, I answered your questions, here are mine:

1. Do you think it is acceptable for a government minister to break public health guidelines approved by his cabinet in the middle of a pandemic, and if not should there be repercussions?

2. Are you a member of Fianna Fail?

@rosney But it's because of what went on before that there's the criticism of checking his pockets for notes.
If you're going to be choosey about your media appearances then you have to be assured in what you are doing.
It adds to the impression of someone not in command of his brief.

@timoconnorbl @NoonanJoe @CllrDesCahil @EoinBearla This "not putting one lobby group ahead of another".

Remind me of what extra enforcement the Council brought in after the taxi lobby told the Echo they were knowingly breaking the law in the Washington St cycle lane?

The business, taxi, private car lobby ALWAYS prioritised.

@timoconnorbl I'm not granting immunity to anyone at all, I've no issue with criticism, but be insightful about it. 
Like I said, I didn't vote SF.
"Woke snowflakes didn't vote right/this is our Trump/Brexit" is lazy commentary.

@timoconnorbl C&amp;S agreement:
"Introduce reductions in the Universal Social Charge (USC) on a fair basis with an emphasis on low and middle income earners."

Nothing there about retaining it or blocking an abolition.
